import React, { useState } from 'react'; 
import propertiesData from '../data/properties.json'; // Importing the properties data

function SearchForm({ onSearch }) {
  const [criteria, setCriteria] = useState({
    type: 'any',
    minPrice: '',
    maxPrice: '',
    minBedrooms: '',
    maxBedrooms: '',
    dateAfter: '',
    dateBefore: '',
    postcode: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCriteria((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const filteredProperties = propertiesData.properties.filter((property) => {
      if (criteria.type !== 'any' && property.type.toLowerCase() !== criteria.type.toLowerCase()) return false;
      if (criteria.minPrice && property.price < parseInt(criteria.minPrice, 10)) return false;
      if (criteria.maxPrice && property.price > parseInt(criteria.maxPrice, 10)) return false;
      if (criteria.minBedrooms && property.bedrooms < parseInt(criteria.minBedrooms, 10)) return false;
      if (criteria.maxBedrooms && property.bedrooms > parseInt(criteria.maxBedrooms, 10)) return false;
      if (
        criteria.dateAfter &&
        new Date(property.added.year, property.added.month - 1, property.added.day) < new Date(criteria.dateAfter)
      )
        return false;
      if (
        criteria.dateBefore &&
        new Date(property.added.year, property.added.month - 1, property.added.day) > new Date(criteria.dateBefore)
      )
        return false;
      if (criteria.postcode && !property.postcode.toLowerCase().startsWith(criteria.postcode.toLowerCase())) return false;
      return true;
    });

    onSearch(filteredProperties);
  };

  return (
    <form className="search-form" onSubmit={handleSubmit}>
      <div className="form-group">
        <label htmlFor="type">Property Type</label>
        <select id="type" name="type" value={criteria.type} onChange={handleChange}>
          <option value="any">Any</option>
          <option value="house">House</option>
          <option value="flat">Flat</option>
        </select>
      </div>

      <div className="form-group">
        <label htmlFor="minPrice">Min Price (£)</label>
        <input
          type="number"
          id="minPrice"
          name="minPrice"
          value={criteria.minPrice}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="maxPrice">Max Price (£)</label>
        <input
          type="number"
          id="maxPrice"
          name="maxPrice"
          value={criteria.maxPrice}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="minBedrooms">Min Bedrooms</label>
        <select id="minBedrooms" name="minBedrooms" value={criteria.minBedrooms} onChange={handleChange}>
          <option value="">Any</option>
          {[1, 2, 3, 4, 5].map((num) => (
            <option key={num} value={num}>
              {num}
            </option>
          ))}
        </select>
      </div>

      <div className="form-group">
        <label htmlFor="maxBedrooms">Max Bedrooms</label>
        <select id="maxBedrooms" name="maxBedrooms" value={criteria.maxBedrooms} onChange={handleChange}>
          <option value="">Any</option>
          {[1, 2, 3, 4, 5].map((num) => (
            <option key={num} value={num}>
              {num}
            </option>
          ))}
        </select>
      </div>

      <div className="form-group">
        <label htmlFor="dateAfter">Added After</label>
        <input
          type="date"
          id="dateAfter"
          name="dateAfter"
          value={criteria.dateAfter}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="dateBefore">Added Before</label>
        <input
          type="date"
          id="dateBefore"
          name="dateBefore"
          value={criteria.dateBefore}
          onChange={handleChange}
        />
      </div>

      <div className="form-group">
        <label htmlFor="postcode">Postcode Area</label>
        <select id="postcode" name="postcode" value={criteria.postcode} onChange={handleChange}>
          <option value="">Any</option>
          {/* Example postcode areas */}
          <option value="NW1">NW1</option>
          <option value="BR1">BR1</option>
          <option value="SW1">SW1</option>
        </select>
      </div>

      <div className="form-group">
        <button type="submit">Search Properties</button>
      </div>
    </form>
  );
}

export default SearchForm;
